import React from 'react'
import './Services.css'
import HeartEmoji from "../../img/heartemoji.png";
import Glasses from"../../img/glasses.png";
import Humble from"../../img/humble.png";
import Card from '../Card/Card';
import CV from"./CV.pdf";
import {themeContext} from '../../Context'
import {useContext} from 'react'

const Services = () => {
  const theme = useContext(themeContext);
  const darkMode = theme.state.darkMode;

  return (
   <div className="services">
     {/* left side */}
     <div className="awesome">
        <span style={{color:darkMode?'white':''}}>
            My Awesome
        </span>
        <span>
            services
        </span>
        <span>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas at rerum repudiandae 
            <br/>
            ipsum est fugiat aperiam repellen
        </span>
        <a href={CV} download>
        <button className="button s-button" >
            Download CV

        </button>
        </a>
       
        <div className="blurns-blur1" style={{background:"#ABF1FF94"}}>

        </div>
     </div>
     {/* right side */}
     <div className="cards">
           <div style={{left:'14rem'}}>
            <Card emoji={HeartEmoji}
            heading={'Design'}
            detail={"figma,Sketch,Photoshop,Adobe, Adob xd"}
            /> 
           </div>
           {/* secondcard */}
           <div style={{top:'12rem',left:"-4rem"}}>
            <Card emoji={Glasses}
            heading={'Developer'}
            detail={"html,css,javascript,react"}
            />
           </div>
           {/* third */}
           <div style={{top:'19rem',left:"12rem"}}>
            <Card emoji={Humble}
            heading={'UI/UX'}
            detail={"lorem lorem  lorem lorem lorem"}
            />
           </div>
           <div className="blur s-blur2 " style={{background:'var(--purple)'}}></div>
     </div>
   </div>
  )
}

export default Services
